INSERT INTO `block_uis` (`id`, `old_id`, `name_bak`, `name`, `sname`, `summary_bak`, `summary`, `summary2`, `module_table`, `idModule`, `deleted_at`, `updated_at`, `log`, `siteid`, `extra_info_bak`, `extra_info`, `image_list`, `old_image_list`, `tags_list`, `created_at`, `status`, `content`, `guide_admin`, `extra_color_background`, `extra_color_text`, `group_name`) VALUES
(1, 1, 'Giới thiệu', '{\"vi\": \"Giới thiệu\"}', NULL, NULL, '{\"vi\": \"\"}', NULL, NULL, NULL, NULL, '2025-10-08 04:09:53', NULL, NULL, NULL, '{\"vi\": \"\"}', NULL, NULL, NULL, '2023-03-28 05:21:38', 1, '<p><strong><br />Tiếp nối thành công chương trình khuyến mại dành cho khách hàng mở tài khoản bằng phương thức định danh trực tuyến eKYC đã triển khai trong năm 2022, Ngân hàng Sài Gòn – Hà Nội (SHB) tiếp tục triển khai ưu đãi “Mở tài khoản – Nhận quà ngay” với nhiều quà tặng hấp dẫn.</strong></p>\n<p>Theo đó, từ nay đến hết ngày 31/12/2023, SHB dành gần 13.000 mã giảm giá 50.000 VNĐ tặng các khách hàng cá nhân lần đầu mở tài khoản thanh toán thành công sớm nhất bằng phương thức định danh trực tuyến eKYC và có giao dịch thành công trên ứng dụng SHB Mobile.</p>\n<p>Bên cạnh đó, các khách hàng còn được tận hưởng gói ưu đãi lên đến 1 triệu đồng và sử dụng nhiều dịch vụ miễn phí:</p>\n- Tặng tài khoản số đẹp trùng với ngày sinh, số điện thoại trị giá 880.000 đồng;<br />- Miễn số dư duy trì tài khoản 50.000 đồng;<br />- Miễn trọn đời phí chuyển khoản liên ngân hàng 24/7.<br />- Tặng thêm 30.000 đồng khi giới thiệu một người bạn mở tài khoản trực tuyến thành công tại SHB (theo thể lệ chương trình tại đây)<br /><br />\n<p><img class=\"aligncenter wp-image-33192 size-full\" src=\"https://www.shb.com.vn/wp-content/uploads/2023/02/da022a053758ed06b449.jpg\" /></p>\n<p><br />Quý khách vui lòng xem hướng dẫn mở tài khoản trực tuyến: <strong><a href=\"https://www.shb.com.vn/wp-content/uploads/2023/02/HDSD-m%E1%BB%9F-TK-eKYC-nh%E1%BA%ADp-m%C3%A3-XINCHAO.pdf\">tại đây</a></strong></p>\n<div>\n<div id=\"Normalcontent\">\n<div id=\"imcontent\">\n<div>Để tải App SHB Mobile, Quý khách vui lòng truy cập <strong><a href=\"https://app.adjust.com/m77bvea\">tại đây</a></strong></div>\n<div> </div>\n<div> </div>\n<div>“Mở tài khoản – Nhận quà ngay” là chương trình khuyến mại được SHB triển khai liên tục và được đông đảo khách hàng hưởng ứng tham gia. Chương trình không những gia tăng lợi ích và nâng cao sự gắn kết giữa khách hàng với SHB, đồng thời góp phần thúc đẩy nhu cầu và tạo dựng thói quen thanh toán không dùng tiền mặt của khách hàng.</div>\n</div>\n</div>\n</div>\n<p>Cũng trong thời gian này, SHB đang triển khai chương trình khuyến mại “Nạp tiền ngày vàng – Rộn ràng ưu đãi” dành tặng mã giảm giá 20.000 đồng cho các khách hàng nạp tiền điện thoại vào các ngày mùng 5, 15, 25 hàng tháng; mỗi khách hàng được nhận 03 mã vào các ngày vàng trong tháng. Chương trình triển khai đến hết 31/12/2023.</p>\n<p>Luôn lấy khách hàng là trọng tâm, SHB đã và đang không ngừng hoàn thiện, nâng cấp sản phẩm, dịch vụ ngân hàng điện tử thông qua việc tích hợp các công nghệ hiện đại và mới nhất. Sử dụng dịch vụ SHB Mobile, khách hàng có thể giao dịch mọi lúc mọi nơi, trải nghiệm những tiện ích tối ưu như: thanh toán hóa đơn, nạp tiền điện thoại, đặt vé máy bay, tiết kiệm Online, mở thẻ/khóa thẻ online…</p>', NULL, NULL, NULL, NULL),
