(7, NULL, NULL, '{\"vi\":null}', 'banner-top', '111', '{\"vi\":\"111\"}', NULL, NULL, NULL, NULL, '2025-10-14 05:46:18', NULL, NULL, 'Dịch vụ theo dõi Uptime Online\nTheo dõi tất cả những gì bạn cần, Gửi thông báo 24/7\nXem ngay\n/member', '{\"en\":\"Monitor anything\\nGet alerts 24/7\\nJoin Now\\n/member\",\"vi\":\"Giám sát mọi thứ\\nNhận thông báo 24/7\\nTham gia ngay\\n/thành viên\",\"ja\":\"何でも監視する\\n24時間365日アラートを受け取る\\n今すぐ参加\\n/メンバー\",\"ko\":\"무엇이든 모니터링\\n연중무휴 알림 받기\\n지금 가입하세요\\n/회원\",\"fr\":\"Surveillez n\'importe quoi\\nRecevez des alertes 24h/24 et 7j/7\\nInscrivez-vous maintenant\\n/membre\",\"de\":\"Überwachen Sie alles\\nErhalten Sie Benachrichtigungen rund um die Uhr\\nJetzt beitreten\\n/Mitglied\",\"es\":\"monitorear cualquier cosa\\nRecibe alertas 24 horas al día, 7 días a la semana\\nÚnete ahora\\n/miembro\",\"km\":\"តាមដានអ្វីទាំងអស់\\nទទួលបានការដាស់តឿន 24/7\\nចូលរួមឥឡូវនេះ\\n/ សមាជិក\",\"ru\":\"Контролируйте что угодно\\nПолучайте оповещения 24/7\\nПрисоединяйтесь сейчас\\n/член\",\"zh\":\"监控任何东西\\n24/7 获取警报\\n立即加入\\n/成员\"}', NULL, NULL, NULL, '2025-09-08 13:51:53', NULL, '222', '8999', NULL, NULL, NULL),
(8, NULL, 'Tính năng chính', '{\"en\":\"Main features\",\"vi\":\"Các tính năng chính\",\"fr\":\"Principales caractéristiques\",\"ja\":\"主な特長\",\"ko\":\"주요 기능\",\"de\":\"Hauptmerkmale\",\"es\":\"Características principales\",\"km\":\"លក្ខណៈពិសេសសំខាន់ៗ\",\"ru\":\"Основные особенности\",\"zh\":\"主要特点\"}', 'tinh-nang', NULL, '{\"en\":null}', NULL, NULL, NULL, NULL, '2025-10-14 05:46:47', NULL, NULL, 'Theo dõi Web/API\nMở đóng port\nKiểm tra Nội dung \n\nChứng chỉ SSL/HTTPS\nKiểm tra hết hạn\nCảnh báo gia hạn\n\nPing Server\nPing Domain\nPing IP\n\nPort TCP/UDP\nTest mở Port\nTest đóng Port', '{\"en\":\"Monitoring &amp; Checking\\nMonitor Website / API\\nCheck Website Availability\\nCheck for Error Content\\nCheck for Valid Content\\n\\nSSL / HTTPS Certificate\\nCheck Expiration Date\\nRenewal Reminder / Alert\\n\\nPing Monitoring\\nPing Server\\nPing Domain\\nPing IP\\n\\nTCP / UDP Ports\\nCheck Open Ports\\nCheck Closed Ports\\nCheck Database Ports\\nCheck Application Ports\",\"vi\":\"Giám sát & Kiểm tra\\nGiám sát trang web/API\\nKiểm tra tính khả dụng của trang web\\nKiểm tra nội dung lỗi\\nKiểm tra nội dung hợp lệ\\n\\nChứng chỉ SSL/HTTPS\\nKiểm tra ngày hết hạn\\nNhắc nhở/Cảnh báo gia hạn\\n\\nGiám sát Ping\\nMáy chủ Ping\\nTên miền Ping\\nPing IP\\n\\nCổng TCP / UDP\\nKiểm tra các cổng đang mở\\nKiểm tra các cổng đã đóng\\nKiểm tra cổng cơ sở dữ liệu\\nKiểm tra cổng ứng dụng\",\"ja\":\"監視とチェック\\nWebサイト/APIの監視\\nウェブサイトの利用状況を確認する\\nエラー内容の確認\\n有効なコンテンツを確認する\\n\\nSSL/HTTPS証明書\\n有効期限を確認する\\n更新のリマインダー/アラート\\n\\nPing監視\\nPingサーバー\\nPing ドメイン\\nIPにpingを送信する\\n\\nTCP/UDPポート\\n開いているポートを確認する\\n閉じられたポートを確認する\\nデータベースポートの確認\\nアプリケーションポートを確認する\",\"ko\":\"모니터링 및 점검\\n웹사이트/API 모니터링\\n웹사이트 가용성 확인\\n오류 내용 확인\\n유효한 콘텐츠 확인\\n\\nSSL/HTTPS 인증서\\n유통기한 확인\\n갱신 알림/알림\\n\\n핑 모니터링\\n핑 서버\\n핑 도메인\\n핑 IP\\n\\nTCP/UDP 포트\\n열린 포트 확인\\n닫힌 포트 확인\\n데이터베이스 포트 확인\\n애플리케이션 포트 확인\",\"fr\":\"Surveillance et vérification\\nSurveiller le site Web/API\\nVérifier la disponibilité du site Web\\nRechercher le contenu de l\'erreur\\nVérifier le contenu valide\\n\\nCertificat SSL/HTTPS\\nVérifier la date d\'expiration\\nRappel/alerte de renouvellement\\n\\nSurveillance des pings\\nServeur Ping\\nDomaine Ping\\nCingler l\'adresse IP\\n\\nPorts TCP/UDP\\nVérifier les ports ouverts\\nVérifier les ports fermés\\nVérifier les ports de la base de données\\nVérifier les ports d\'application\",\"de\":\"Überwachung und Kontrolle\\nÜberwachen Sie die Website/API\\nÜberprüfen Sie die Verfügbarkeit der Website\\nAuf fehlerhaften Inhalt prüfen\\nSuchen Sie nach gültigen Inhalten\\n\\nSSL-/HTTPS-Zertifikat\\nÜberprüfen Sie das Ablaufdatum\\nVerlängerungserinnerung/-warnung\\n\\nPing-Überwachung\\nPing-Server\\nPing-Domäne\\nPing-IP\\n\\nTCP-/UDP-Ports\\nAktivieren Sie „Offene Ports“.\\nÜberprüfen Sie die geschlossenen Ports\\nÜberprüfen Sie die Datenbankports\\nÜberprüfen Sie die Anwendungsports\",\"es\":\"Monitoreo y verificación\\nMonitorear sitio web/API\\nVerifique la disponibilidad del sitio web\\nComprobar contenido de error\\nVerificar contenido válido\\n\\nCertificado SSL/HTTPS\\nVerificar fecha de vencimiento\\nRecordatorio/Alerta de renovación\\n\\nMonitoreo de ping\\nServidor de ping\\nDominio de ping\\nHacer ping a IP\\n\\nPuertos TCP/UDP\\nVerificar puertos abiertos\\nVerificar puertos cerrados\\nVerifique los puertos de la base de datos\\nVerifique los puertos de la aplicación\",\"km\":\"ការត្រួតពិនិត្យនិងការត្រួតពិនិត្យ\\nគេហទំព័រត្រួតពិនិត្យ / API\\nពិនិត្យមើលភាពអាចរកបានគេហទំព័រ\\nពិនិត្យមាតិកាកំហុស\\nពិនិត្យមើលមាតិកាត្រឹមត្រូវ\\n\\nវិញ្ញាបនបត្រ SSL / HTTPS\\nពិនិត្យមើលកាលបរិច្ឆេទផុតកំណត់\\nការចងចាំឡើងវិញ / ការដាស់តឿន\\n\\nPing តាមដាន\\nម៉ាស៊ីនបម្រើភីង\\nPing ដែន\\nភីងអាយភី\\n\\nកំពង់ផែ TCP / UDP\\nពិនិត្យកំពង់ផែបើកចំហ\\nពិនិត្យកំពង់ផែបិទទ្វារ\\nពិនិត្យច្រកមូលដ្ឋានទិន្នន័យ\\nពិនិត្យមើលកំពង់ផែកម្មវិធី\",\"ru\":\"Мониторинг и проверка\\nМониторинг веб-сайта/API\\nПроверить доступность сайта\\nПроверьте содержимое ошибки\\nПроверьте допустимый контент\\n\\nSSL/HTTPS-сертификат\\nПроверьте дату истечения срока действия\\nНапоминание о продлении/предупреждение\\n\\nПинг-мониторинг\\nПинг-сервер\\nПинг домена\\nПинг IP\\n\\nTCP/UDP-порты\\nПроверьте открытые порты\\nПроверьте закрытые порты\\nПроверьте порты базы данных\\nПроверьте порты приложений\",\"zh\":\"监控与检查\\n监控网站/API\\n检查网站可用性\\n检查错误内容\\n检查内容是否有效\\n\\nSSL/HTTPS 证书\\n检查到期日期\\n续订提醒/警报\\n\\nPing 监控\\nPing 服务器\\n平域\\n平IP\\n\\nTCP / UDP 端口\\n检查开放端口\\n检查关闭的端口\\n检查数据库端口\\n检查应用程序端口\"}', NULL, NULL, NULL, '2025-09-08 13:54:28', NULL, NULL, NULL, NULL, NULL, NULL),
