(12, NULL, NULL, '{\"en\":null}', 'our-team', NULL, '{\"en\":null}', NULL, NULL, NULL, NULL, '2025-10-14 06:14:10', NULL, NULL, 'Phạm Vinh\nCEO \nUptimeRobot giúp ích rất nhiều cho sự an toàn của hệ thống chúng tôi, hệ thống thực sự hiệu quả\n\nJohnSon\nTechnical Specialist\nChúng tôi không cần xây dựng hệ thống alert riêng mà chỉ cần sử dụng của UpTimeRobot\n\nDuy Hưng\nProgrammer\nTôi dùng miễn phí cũng đã rất tốt cho nhu cầu rồi, nếu cần nâng cấp cũng rất tiết kiệm\n\nLê Hà\nInvestment Planner\nSử dụng rất đơn giản và hiệu quả, chi phí rất rẻ,  một cốc cafe 1 tháng mà mang lại lợi ích cả trăm lần', '{\"en\":\"Matthew\\nTechnical Specialist\\nWe don\'t need to spend money on building our own alert system, we just need to use Ping2U\'s.\\n\\nRyan\\nProgrammer\\nI use free which is also suitable for my needs, if need to upgrade it is also very economical\\n\\n健太\\nInvestment Planner\\nVery simple and effective to use, very cheap, a cup of coffee a month brings great benefits\\n\\nPhạm Vinh\\nCEO \\nPing2U helps a lot with the safety of our system, it is really efficient\",\"vi\":\"Phạm Vinh\\nGiám đốc điều hành \\nPing2U giúp ích rất nhiều cho sự an toàn của hệ thống của chúng tôi, nó thực sự hiệu quả\\n\\n\\nJohnSon\\nChuyên gia kỹ thuật\\nChúng tôi không cần tốn tiền xây dựng hệ thống cảnh báo của riêng mình, chúng tôi chỉ cần sử dụng Ping2U.\\n\\ncông việc thanh toán\\nLập trình viên\\nMình dùng free cũng phù hợp với nhu cầu, nếu có nhu cầu nâng cấp cũng rất tiết kiệm\\n\\nLee Jong Kim\\nNgười lập kế hoạch đầu tư\\nCách sử dụng rất đơn giản và hiệu quả, lại rất rẻ, một tách cà phê mỗi tháng mang lại lợi ích to lớn\",\"ja\":\"ファムビン\\n最高経営責任者（CEO） \\nPing2U はシステムの安全性に非常に役立ち、非常に効率的です\\n\\n\\nジョンソン\\nテクニカルスペシャリスト\\n独自の警報システムの構築にお金を費やす必要はなく、Ping2U を使用するだけで済みます。\\n\\nビル・ジョブ\\nプログラマー\\n私は無料のものを使用していますが、私のニーズにも適しています。アップグレードが必要な場合も非常に経済的です。\\n\\nイ・ジョンキム\\n投資プランナー\\n使い方は非常にシンプルで効果的で、非常に安価で、月に一杯のコーヒーで大きな効果が得られます。\",\"ko\":\"팜빈\\nCEO \\nPing2U는 우리 시스템의 안전에 많은 도움을 주며, 정말 효율적입니다.\\n\\n\\n존손\\n기술 전문가\\n우리는 자체 경보 시스템을 구축하는 데 돈을 쓸 필요가 없으며 Ping2U만 사용하면 됩니다.\\n\\n빌 직업\\n프로그램 제작자\\n나는 내 필요에 맞는 무료를 사용하고 있으며 업그레이드가 필요한 경우에도 매우 경제적입니다.\\n\\n이종김\\n투자 플래너\\n사용이 매우 간단하고 효과적이며 매우 저렴하며 한 달에 커피 한 잔은 큰 이점을 제공합니다.\",\"fr\":\"Phạm Vinh\\nPDG \\nPing2U aide beaucoup à la sécurité de notre système, il est vraiment efficace\\n\\n\\nJohnFils\\nSpécialiste technique\\nNous n\'avons pas besoin de dépenser de l\'argent pour créer notre propre système d\'alerte, il nous suffit d\'utiliser celui de Ping2U.\\n\\nBill Job\\nProgrammeur\\nJ\'utilise Free qui convient également à mes besoins, si besoin de mettre à niveau, c\'est aussi très économique\\n\\nLee Jongkim\\nPlanificateur d\'investissement\\nTrès simple et efficace à utiliser, très bon marché, une tasse de café par mois apporte de grands bienfaits\",\"de\":\"Phạm Vinh\\nCEO \\nPing2U trägt sehr zur Sicherheit unseres Systems bei, es ist wirklich effizient\\n\\n\\nJohnSon\\nTechnischer Spezialist\\nWir müssen kein Geld für den Aufbau unseres eigenen Warnsystems ausgeben, sondern müssen lediglich Ping2Us verwenden.\\n\\nBill Job\\nProgrammierer\\nIch verwende kostenlos, was auch für meine Bedürfnisse geeignet ist, und wenn ein Upgrade erforderlich ist, ist es auch sehr wirtschaftlich\\n\\nLee Jongkim\\nInvestitionsplaner\\nSehr einfach und effektiv in der Anwendung, sehr günstig, eine Tasse Kaffee im Monat bringt große Vorteile\",\"es\":\"Phạm Vinh\\ndirector ejecutivo \\nPing2U ayuda mucho con la seguridad de nuestro sistema, es realmente eficiente\\n\\n\\nJuanHijo\\nEspecialista Técnico\\nNo necesitamos gastar dinero en construir nuestro propio sistema de alerta, solo necesitamos usar Ping2U.\\n\\nTrabajo de factura\\nProgramador\\nUtilizo gratis, que también se adapta a mis necesidades, si necesito actualizarlo también es muy económico\\n\\nLee Jong Kim\\nPlanificador de inversiones\\nMuy sencillo y efectivo de utilizar, muy económico, una taza de café al mes trae grandes beneficios\",\"km\":\"ភក់វីនី\\nនាយកប្រតិបត្តិ \\nភីង 2u ជួយបានច្រើនជាមួយនឹងសុវត្ថិភាពនៃប្រព័ន្ធរបស់យើងវាពិតជាមានប្រសិទ្ធភាពណាស់\\n\\n\\nចនសុន\\nអ្នកឯកទេសបច្ចេកទេស\\nយើងមិនចាំបាច់ចំណាយប្រាក់លើការកសាងប្រព័ន្ធដាស់តឿនរបស់យើងទេយើងគ្រាន់តែត្រូវការប្រើ Ping2u ប៉ុណ្ណោះ។\\n\\nបេឡារុស្ស\\nអ្នកប្យួរ\\nខ្ញុំប្រើឥតគិតថ្លៃដែលសមរម្យផងដែរសម្រាប់តម្រូវការរបស់ខ្ញុំប្រសិនបើត្រូវការធ្វើឱ្យប្រសើរឡើងវាក៏សន្សំសំចៃខ្លាំងផងដែរ\\n\\nលីជុងឃីម\\nអ្នករៀបចំផែនការវិនិយោគ\\nសាមញ្ញបំផុតនិងមានប្រសិទ្ធភាពក្នុងការប្រើប្រាស់ដែលមានតំលៃថោកកាហ្វេមួយកែវកាហ្វេមួយក្នុងមួយខែនាំមកនូវអត្ថប្រយោជន៍យ៉ាងច្រើន\",\"ru\":\"Фам Винь\\nГенеральный директор \\nPing2U очень помогает с безопасностью нашей системы, он действительно эффективен.\\n\\n\\nДжонСон\\nТехнический специалист\\nНам не нужно тратить деньги на создание собственной системы оповещения, нам просто нужно использовать Ping2U.\\n\\nБилл Джоб\\nПрограммист\\nЯ использую бесплатную версию, которая также подходит для моих нужд. Если потребуется обновить ее, это также очень экономично.\\n\\nЛи Чонким\\nИнвестиционный планировщик\\nОчень простой и эффективный в использовании, очень дешевый, чашка кофе в месяц приносит огромную пользу.\",\"zh\":\"范荣\\n首席执行官 \\nPing2U 对我们系统的安全有很大帮助，非常高效\\n\\n\\n强生\\n技术专家\\n我们不需要花钱建立自己的警报系统，我们只需要使用 Ping2U 的即可。\\n\\n比尔·乔布\\n程序员\\n我用的是免费的也很适合我的需求，如果需要升级也很经济\\n\\n李钟金\\n投资策划师\\n使用非常简单有效，非常便宜，一个月一杯咖啡带来很大好处\"}', '1,5,6,4', NULL, NULL, '2025-09-08 14:18:12', NULL, NULL, NULL, NULL, NULL, NULL),
