INSERT INTO `conference_infos` (`id`, `old_id`, `name`, `sub_title`, `summary`, `images`, `cat`, `key_notes`, `user_id`, `old_user_id`, `status`, `created_at`, `updated_at`, `deleted_at`, `image_list`, `old_image_list`, `log`, `conf1_video`, `conf1_images`, `conf1_image_title`, `conf1_timesheet`, `conf1_keynote`, `conf1_name`, `conf2_name`, `conf2_keynote`, `conf2_timesheet`, `conf2_images`, `conf2_image_title`, `conf2_video`, `conf3_video`, `conf3_images`, `conf3_image_title`, `conf3_timesheet`, `conf3_keynote`, `conf3_name`, `video_bottom`, `supporters`, `right_column`, `orders`) VALUES
(1, 1, 'DEMO - ReadOnly', '4-6 June 2024, Hilton Kuala Lumpur', 'The Asia-Pacific Roundtable (APR) is the signature international conference of the Institute of Strategic &amp; International Studies (ISIS) Malaysia. At its core, the APR is a Southeast Asian conference discussing key issues impacting on the Asia-Pacific. It is one of the region’s premier Track-Two gatherings and is ranked among the world’s top 20 think-tank strategic-security focused conferences.\n\nConvened by ISIS Malaysia, on behalf of the ASEAN Institutes of Strategic and International Studies (ASEAN-ISIS) network, a network of leading Southeast Asian policy institutes and think-tanks, it regularly attracts more than 300 thinkers of various backgrounds who engage in lively, frank and constructive conversations on issues shaping the security, stability, sustainability and prosperity of the Asia-Pacific region. The aim is for insights into how businesses and governments can navigate an increasingly complex strategic landscape.\n\nThis year’s theme is ‘Crisis in an Interregnum’. It aims to unpack how this period of interregnum affects the norms and mechanisms that have shaped the existing international order. How will established and emerging middle and major powers operate in such an environment? How will they seek common ground and cooperation, if at all? What are the emerging structures and rules being shaped?\n\nThe organisers are again waiving the traditional conference fee. Delegates are expected to cover their own transport and accommodation costs. Hilton Kuala Lumpur will offer the best room rates for those who wish to stay at the conference venue.', '3164', 1, 'KEYNOTE ADDRESS &amp; REMARKS1\nhttps://www.youtube.com/watch?v=tVjRaXi3MDg\nhttps://www.youtube.com/watch?v=Am8xhVWtfdc\nhttps://www.youtube.com/watch?v=PiQnE1qE3Ns\nhttps://www.youtube.com/watch?v=Am8xhVWtfdc', NULL, NULL, 1, '2024-09-25 08:45:10', '2025-08-15 05:29:16', NULL, NULL, NULL, NULL, NULL, '3173,3172,3171,3170,3169,3168,3167,3166', 'Day 1 - Gallery', '[08:00 - 09:00] \ntype = 1\ntitle = Time 1... Registration\nimage1 = 3178, Mô tả Ảnh 1\nimage2 = 3179, Mô tả Ảnh 2\n\n\n[10:00 - 11:00] \ntitle= Time 3\n\n\n[09:00 - 10:00 ]\ntype=2 \ntitle = Time 2...\nsummary=Tensions between US and China have created an environment of distrust and uncertainty. As major-power rivalry heightens, the growing risk of miscalculation and unintended clashes have sparked a need for greater crisis communication. Are existing mechanisms like APEC, EAS or G20 conducive for promoting dialogue and cooperation? If not, what new platforms are needed? Is there a role for small and medium powers to foster mitigation and cooperation?\nimage1 = 3162, Mô tả Ảnh 1123\nimage2 = 3160, Mô tả Ảnh 13\nimage3 = 3161, Mô tả Ảnh 12\n\n[19:45] \ntitle= Time 4\n\n\n[09:10 - 09:30] \ntitle= End of proceedings for the day', NULL, 'Day 1 – Wednesday, 5 June 2024', 'Day 2 – Thursday, 6 June 2024', NULL, '[08:10 - 09:10] \ntype = 1\ntitle = Đăng ký\nimage1 = 3162, Mô tả Ảnh 1\n\n[09:30 - 11:00] \ntitle= Thảo luận\n\n[16:00 - 17:00]\ntype=2 \ntitle = Opening , welcoming remarks\nimage1 = 3162, Mô tả Ảnh 21\nimage2 = 3161, Mô tả Ảnh 22\nimage3 = 3160, Mô tả Ảnh 23\n\n\n[20:00] \ntitle=Kết thúc', '3160,3159,3161,3177', 'Day 2 - Gallery', NULL, NULL, '3176,3172,3171,3170,3168,3167', 'Day 3 - Gallery', '[1h-2h] \ntype = 1\ntitle = Registration\nimage1 = 3162, Mô tả Ảnh 1\nimage2 = 3161, Mô tả Ảnh 2\nimage3 = 3160, Mô tả Ảnh 3\n\n[2h-3h]\ntype=2 \ntitle = Opening + welcoming remarks\nimage1 = 3162, Mô tả Ảnh 31\nimage2 = 3161, Mô tả Ảnh 32\nimage3 = 3160, Mô tả Ảnh 33\n\n\n[2h-4h] \ntitle= Plenary 1 – Major-power rivalry: between mitigation and cooperation\n\n\n[5h] \ntitle=End of proceedings for the day', NULL, 'Day 3', 'https://www.youtube.com/watch?v=tVjRaXi3MDg\nhttps://www.youtube.com/watch?v=Am8xhVWtfdc\nhttps://www.youtube.com/watch?v=PiQnE1qE3Ns', '3171,3176,3173,3172', '[37th APR REPORT1]\nimage=3171\nfile=3180,3160,3161,3162\n\n[KEYNOTE ADDRESS REMARKS]\nimage=3176\nfile=3179,3178,3176', 0),
(2, 2, '37th Asia-Pacific Roundtable Crisis in an Interregnum', '4-6 June 2024, Hilton Kuala Lumpur', 'The Asia-Pacific Roundtable (APR) is the signature international conference of the Institute of Strategic &amp; International Studies (ISIS) Malaysia. At its core, the APR is a Southeast Asian conference discussing key issues impacting on the Asia-Pacific. It is one of the region’s premier Track-Two gatherings and is ranked among the world’s top 20 think-tank strategic-security focused conferences.\n\nConvened by ISIS Malaysia, on behalf of the ASEAN Institutes of Strategic and International Studies (ASEAN-ISIS) network, a network of leading Southeast Asian policy institutes and think-tanks, it regularly attracts more than 300 thinkers of various backgrounds who engage in lively, frank and constructive conversations on issues shaping the security, stability, sustainability and prosperity of the Asia-Pacific region. The aim is for insights into how businesses and governments can navigate an increasingly complex strategic landscape.\n\nThis year’s theme is ‘Crisis in an Interregnum’. It aims to unpack how this period of interregnum affects the norms and mechanisms that have shaped the existing international order. How will established and emerging middle and major powers operate in such an environment? How will they seek common ground and cooperation, if at all? What are the emerging structures and rules being shaped?\n\nThe organisers are again waiving the traditional conference fee. Delegates are expected to cover their own transport and accommodation costs. Hilton Kuala Lumpur will offer the best room rates for those who wish to stay at the conference venue.', '3164', 1, 'title= KEYNOTE ADDRESS &amp; REMARKS1\nhttps://www.youtube.com/watch?v=tVjRaXi3MDg\nhttps://www.youtube.com/watch?v=Am8xhVWtfdc\nhttps://www.youtube.com/watch?v=PiQnE1qE3Ns\nhttps://www.youtube.com/watch?v=Am8xhVWtfdc', NULL, NULL, 0, '2024-09-26 15:36:26', '2025-08-15 05:29:16', NULL, NULL, NULL