(5, 5, NULL, 'Thử phần mềm', NULL, 0, 0, 0, NULL, NULL, NULL, NULL, '2024-03-04 17:00:00', '2025-08-15 05:29:23', NULL, NULL, NULL, NULL, 80, NULL, 'Viện NCBD', NULL, '2024-03-29 08:00:00', '2024-03-29 12:00:00', 'Thư  mời tham dự hội thảo Biển đông 2024', '<span style=\"color:#808000;\"><strong>25-26 October 2023, Ho Chi Minh City, Vietnam<br><span style=\"color:#ff6600;\">THE 15TH SOUTH CHINA SEA INTERNATIONAL CONFERENCELUMINATE THE GREY, LIGHT UP THE GREEN</span><br><img src=\"/slink/9/000/002/34060c0600\" alt=\"34060c0600\"><br><br></strong></span>\n<div class=\"naeep-schedule-list\">\n<div class=\"col-na-row align-items-center\">\n<div class=\"col-na-10\">\n<div class=\"schedule-content\">8.00 am -8.05 am (GMT+7)<br>\n<h3>OPENING</h3>\n<p>- Dr. Pham Lan Dung, Acting President of the Diplomatic Academy of Viet Nam</p>\n</div>\n</div>\n</div>\n</div>\n<div class=\"naeep-schedule-list\">\n<div class=\"col-na-row align-items-center\">\n<div class=\"col-na-10\">\n<div class=\"schedule-content\"> </div>\n<div class=\"schedule-content\" style=\"text-align:left;\"><a href=\"/xacnhan\" style=\"border:0px solid #FF0000;text-decoration:none;display:inline-block;padding:5px 10px;background-color:#4169e1;color:#ffffff;\"><strong><i class=\"ti-timer\"> Xác nhận hoặc Từ chối tham gia</i></strong> </a></div>\n<div class=\"schedule-content\"><br>Vui lòng xác nhận trước...</div>\n<div class=\"schedule-content\"><i class=\"ti-timer\"><br><img class=\"img-responsive-glx\" src=\"/slink/36/000/002/35070d0700\" alt=\"35070d0700\"><br><br><br></i>8.05 am - 8.20 am (GMT+7)<br>\n<h3>OPENING KEYNOTE</h3>\n<p>- H.E. Mr. Do Hung Viet, Vice Minister for Foreign Affairs of Vietnam</p>\n</div>\n</div>\n</div>\n</div>\n<div class=\"naeep-schedule-list\">\n<div class=\"col-na-row align-items-center\">\n<div class=\"col-na-2\">\n<div class=\"schedule-image\">DAY 1: LUMINATE THE GREY</div>\n</div>\n<div class=\"col-na-10\"> </div>\n</div>\n</div>\n<div class=\"naeep-schedule-list\">\n<div class=\"col-na-row align-items-center\">\n<div class=\"col-na-10\">\n<div class=\"schedule-content\"><i class=\"ti-timer\"></i> 8.20 am - 9.50 am (GMT+7)<br>\n<h3>SESSION 1. The South China Sea: 15 Years on</h3>\n<p>Fifteen years have passed since the Diplomatic Academy of Vietnam held its first South China Sea Conference. The South China Sea disputes have not only remained unresolved but also grew into a major geo-strategic hotspot. While maritime cooperation improved in certain areas, differences and mistrust remain. How has the situation in the South China Sea evolved over the past 15 years? ...</p>\n</div>\n</div>\n</div>\n</div>', NULL, NULL, NULL, NULL, NULL, 'Xin moi quy khach tham du... Neu dong y tham du, hay tra loi \'Y\', khong tham du, tra loi \'N\'', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0),
